:\"Question Set\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Question Set\"},\"subContentId\":\"8d410f5c-713f-47a8-a573-125ec4f4df6e\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Activity 2: Fauna, Flora, Biocenosis and Biotope</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"38576327-6cbe-4fa7-8e1c-5b7c5993243e\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"<p>Complete the following statements by dragging the terms into their corresponding slots.<br />\\n</p>\\n\",\"overallFeedback\":[{\"from\":0,\"to\":100}],\"checkAnswer\":\"Check\",\"tryAgain\":\"Retry\",\"showSolution\":\"Show solution\",\"dropZoneIndex\":\"Drop Zone @index.\",\"empty\":\"Drop Zone @index is empty.\",\"contains\":\"Drop Zone @index contains draggable @draggable.\",\"ariaDraggableIndex\":\"@index of @count draggables.\",\"tipLabel\":\"Show tip\",\"correctText\":\"Correct!\",\"incorrectText\":\"Incorrect!\",\"resetDropTitle\":\"Reset drop\",\"resetDropDescription\":\"Are you sure you want to reset this drop zone?\",\"grabbed\":\"Draggable is grabbed.\",\"cancelledDragging\":\"Cancelled dragging.\",\"correctAnswer\":\"Correct answer:\",\"feedbackHeader\":\"Feedback\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"instantFeedback\":false},\"scoreBarLabel\":\"You got :num out of :total points\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"textField\":\"1. Fauna comes from the Latin word *faun*, which is related to animals. Therefore, fauna is the set of the *animals* in an ecosystem.\\n2. Flora comes from the Latin word *floral*, which is related to flowers. Therefore, flora is the set of the *plants* in an ecosystem.\\n3. Biocenosis is a word made up by combining the terms &quot;bios&quot; and *cenosis* together. Bios means life and cenosis means sharing.Therefore, biocenosis is a group of *living things* sharing the same area and resources.\\n4. Biotope is a word made up by combining the terms *bios* and *topos* together. Bios means life and topos means place.Therefore, abiotope is an *area* occupied by living organisms and has uniform environmental factors.\",\"submitAnswer\":\"Submit\",\"media\":{\"disableImageZooming\":false}},\"library\":\"H5P.DragText 1.10\",\"metadata\":{\"contentType\":\"Drag the Words\",\"license\":\"U\",\"title\":\"Drag Text\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Drag Text\"},\"subContentId\":\"43f83bd5-07bd-4d68-b55e-4eb47c3ee957\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Activity 3:Interdependence between Biotope and Biocenosis</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"bbd54205-8491-4c06-9307-a6c5697f961f\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA+YAAAEqCAIAAAAXt92WAAAAAXNSR0ICQMB9xQAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAAAZdEVYdFNvZnR3YXJlAE1pY3Jvc29mdCBPZmZpY2V/7TVxAADFHElEQVR4Xuy9B4AkR3no31XVafLmvd3LOep0J50CEhI5GQwGEwwOYDA2DoD9bGMbwwPsv9PDJj6w/UwwJkcDBhRQTiie0gVdDpvz5I5V9f+qZ+5u7zbvbd7vp9beTE9Ph+qe6V/VfPUVkVJqCIIgCIIgCIIsVGj1XwRBEARBEARBFiTYyo4sU37R5VUfIQiCIJOGC213o5E2sckPQeYUVHZkmfIHdw1WHyEIgiCTA4wh4PIvr8lsqtGrsxAEmRNQ2ZFlyvvvGao+QhAEQSaHiJT9z/elN2ZQ2RFkTsEfthAEQRAEmRQkmhAEmXtQ2REEQRAEQRBkQYPKjiAIgiAIgiALGlR2BEEQBEEQBFnQoLIjCIIgCIIgyIIGlR1BEARBEARBFjSo7AiCIAiCIAiyoEFlRxAEQRAEQZAFDSo7giAIgiAIgixoUNkRBEEQBEEQZEGDyo4gCDI 3\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"taskDescription\":\"<p>3. Drag the terms into their corresponding slots.</p>\\n\",\"overallFeedback\":[{\"from\":0,\"to\":100}],\"checkAnswer\":\"Check\",\"tryAgain\":\"Retry\",\"showSolution\":\"Show solution\",\"dropZoneIndex\":\"Drop Zone @index.\",\"empty\":\"Drop Zone @index is empty.\",\"contains\":\"Drop Zone @index contains draggable @draggable.\",\"ariaDraggableIndex\":\"@index of @count draggables.\",\"tipLabel\":\"Show tip\",\"correctText\":\"Correct!\",\"incorrectText\":\"Incorrect!\",\"resetDropTitle\":\"Reset drop\",\"resetDropDescription\":\"Are you sure you want to reset this drop zone?\",\"grabbed\":\"Draggable is grabbed.\",\"cancelledDragging\":\"Cancelled dragging.\",\"correctAnswer\":\"Correct answer:\",\"feedbackHeader\":\"Feedback\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"instantFeedback\":false},\"scoreBarLabel\":\"You got :num out of :total points\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"textField\":\"a. Blue whales live and thrive in *saltwater*.\\nb. Small fish protect themselves from predators by hiding in *coral reefs*.\\nc. Squirrels dig their *nests* in trees.\\nd. Each of these living organisms grow in a specific *location* with specific *environmental* conditions.\\nf. This shows that there is a *relation* between the biotope and the biocenosis.\",\"submitAnswer\":\"Submit\",\"media\":{\"disableImageZooming\":false}},\"library\":\"H5P.DragText 1.10\",\"metadata\":{\"contentType\":\"Drag the Words\",\"license\":\"U\",\"title\":\"Drag Text\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Drag Text\"},\"subContentId\":\"654b5f81-95d4-4b8d-adae-5397e32edb8e\"},\"useSeparator\":
